In addition to telling the user exactly why their code is wrong, it's oftentimes furthermore possible to tell them how to fix it. To this end, DiagnosticBuilder offers a structured suggestions API, which formats code suggestions pleasingly in the terminal, or (when the --error-format json flag is passed) as JSON for consumption by tools, most notably the Rust Language Server and rustfix . Not all suggestions should be applied mechanically. Use the span_suggestion method of DiagnosticBuilder to make a suggestion. The last argument provides a hint to tools whether the suggestion is mechanically applicable or not. For example, to make our qux suggestion machine-applicable, we would do: let mut err = sess.struct_span_err(sp, "oh no! this is an error!"); if let Ok(snippet) = sess.source_map().span_to_snippet(sp) { err.span_suggestion( suggestion_sp, "try using a qux here", format!("qux {}", snippet), Applicability::MachineApplicable, );
} else { err.span_help(suggestion_sp, "you could use a qux here instead");
} err.emit(); This might emit an error like $ rustc mycode.rs
error[E0999]: oh no! this is an error! --> mycode.rs:3:5 |
3 | sad() | ^ help: try using a qux here: `qux sad()` error: aborting due to previous error For more information about this error, try `rustc --explain E0999`. In some cases, like when the suggestion spans multiple lines or when there are multiple suggestions, the suggestions are displayed on their own: error[E0999]: oh no! this is an error! --> mycode.rs:3:5 |
3 | sad() | ^
help: try using a qux here: |
3 | qux sad() | ^^^ error: aborting due to previous error For more information about this error, try `rustc --explain E0999`. The possible values of Applicability are: MachineApplicable: Can be applied mechanically. HasPlaceholders: Cannot be applied mechanically because it has placeholder text in the suggestions. For example, "Try adding a type: `let x: <type>`". MaybeIncorrect: Cannot be applied mechanically because the suggestion may or may not be a good one. Unspecified: Cannot be applied mechanically because we don't know which of the above cases it falls into.

