Sometimes we want to change the behavior of a lint in a new edition. To do this, we just add the transition to our invocation of declare_lint!: declare_lint! { pub ANONYMOUS_PARAMETERS, Allow, "detects anonymous parameters", Edition::Edition2018 => Warn,
} This makes the ANONYMOUS_PARAMETERS lint allow-by-default in the 2015 edition but warn-by-default in the 2018 edition. A future-incompatible lint should be declared with the @future_incompatible additional "field": declare_lint! { pub ANONYMOUS_PARAMETERS, Allow, "detects anonymous parameters", @future_incompatible = FutureIncompatibleInfo { reference: "issue #41686 <https://github.com/rust-lang/rust/issues/41686>", edition: Some(Edition::Edition2018), };
} If you need a combination of options that's not supported by the declare_lint! macro, you can always define your own static with a type of &Lint but this is currently linted against in the compiler tree. Guidelines for creating a future incompatibility lint Create a lint defaulting to warn as normal, with ideally the same error message you would normally give. Add a suitable reference, typically an RFC or tracking issue. Go ahead and include the full URL, sort items in ascending order of issue numbers. Later, change lint to error. Eventually, remove lint.

