How does this DAG of query invocations come into existence? At some point the compiler driver will create the, as yet empty, query context. It will then, from outside of the query system, invoke the queries it needs to perform its task. This looks something like the following: fn compile_crate() { let cli_options = ...; let hir_map = ...; // Create the query context `tcx` let tcx = TyCtxt::new(cli_options, hir_map); // Do type checking by invoking the type check query tcx.type_check_crate();
} The type_check_crate query provider would look something like the following: fn type_check_crate_provider(tcx, _key: ()) { let list_of_hir_items = tcx.hir_map.list_of_items(); for item_def_id in list_of_hir_items { tcx.type_check_item(item_def_id); }
} We see that the type_check_crate query accesses input data (tcx.hir_map.list_of_items()) and invokes other queries (type_check_item). The type_check_item invocations will themselves access input data and/or invoke other queries, so that in the end the DAG of query invocations will be built up backwards from the node that was initially executed: (2) (1) list_of_all_hir_items <----------------------------- type_check_crate() | (5) (4) (3) | Hir(foo) <--- type_of(foo) <--- type_check_item(foo) <-------+ | | +-----------------+ | | | (7) v (6) (8) | Hir(bar) <--- type_of(bar) <--- type_check_item(bar) <-------+ // (x) denotes invocation order We also see that often a query result can be read from the cache: type_of(bar) was computed for type_check_item(foo) so when type_check_item(bar) needs it, it is already in the cache. Query results stay cached in the query context as long as the context lives. So if the compiler driver invoked another query later on, the above graph would still exist and already executed queries would not have to be re-done.

