Opaque types are syntax to declare an opaque type alias that only exposes a specific set of traits as their interface; the concrete type in the background is inferred from a certain set of use sites of the opaque type. This is expressed by using impl Trait within type aliases, for example: type Foo = impl Bar; This declares an opaque type named Foo, of which the only information is that it implements Bar. Therefore, any of Bar's interface can be used on a Foo, but nothing else (regardless of whether it implements any other traits). Since there needs to be a concrete background type, you can currently express that type by using the opaque type in a "defining use site". struct Struct;
impl Bar for Struct { /* stuff */ }
fn foo() -> Foo { Struct
} Any other "defining use site" needs to produce the exact same type.

