Miri ( MIR I nterpreter) is a virtual machine for executing MIR without compiling to machine code. It is usually invoked via tcx.const_eval. If you start out with a constant const FOO: usize = 1 << 12; rustc doesn't actually invoke anything until the constant is either used or placed into metadata. Once you have a use-site like type Foo = [u8; FOO - 42]; The compiler needs to figure out the length of the array before being able to create items that use the type (locals, constants, function arguments, ...). To obtain the (in this case empty) parameter environment, one can call let param_env = tcx.param_env(length_def_id);. The GlobalId needed is let gid = GlobalId { promoted: None, instance: Instance::mono(length_def_id),
}; Invoking tcx.const_eval(param_env.and(gid)) will now trigger the creation of the MIR of the array length expression. The MIR will look something like this: const Foo::{{initializer}}: usize = { let mut _0: usize; // return pointer let mut _1: (usize, bool); bb0: { _1 = CheckedSub(const Unevaluated(FOO, Slice([])), const 42usize); assert(!(_1.1: bool), "attempt to subtract with overflow") -> bb1; } bb1: { _0 = (_1.0: usize); return; }
} Before the evaluation, a virtual memory location (in this case essentially a vec![u8; 4] or vec![u8; 8]) is created for storing the evaluation result. At the start of the evaluation, _0 and _1 are Operand::Immediate(Immediate::Scalar(ScalarMaybeUndef::Undef)). This is quite a mouthful: Operand can represent either data stored somewhere in the interpreter memory (Operand::Indirect), or (as an optimization) immediate data stored in-line. And Immediate can either be a single (potentially uninitialized) scalar value (integer or thin pointer), or a pair of two of them. In our case, the single scalar value is not (yet) initialized. When the initialization of _1 is invoked, the value of the FOO constant is required, and triggers another call to tcx.const_eval, which will not be shown here. If the evaluation of FOO is successful, 42 will be subtracted from its value 4096 and the result stored in _1 as Operand::Immediate(Immediate::ScalarPair(Scalar::Raw { data: 4054, .. }, Scalar::Raw { data: 0, .. }). The first part of the pair is the computed value, the second part is a bool that's true if an overflow happened. A Scalar::Raw also stores the size (in bytes) of this scalar value; we are eliding that here. The next statement asserts that said boolean is 0. In case the assertion fails, its error message is used for reporting a compile-time error. Since it does not fail, Operand::Immediate(Immediate::Scalar(Scalar::Raw { data: 4054, .. })) is stored in the virtual memory was allocated before the evaluation. _0 always refers to that location directly. After the evaluation is done, the return value is converted from Operand to ConstValue by op_to_const : the former representation is geared towards what is needed during cost evaluation, while ConstValue is shaped by the needs of the remaining parts of the compiler that consume the results of const evaluation. As part of this conversion, for types with scalar values, even if the resulting Operand is Indirect, it will return an immediate ConstValue::Scalar(computed_value) (instead of the usual ConstValue::ByRef). This makes using the result much more efficient and also more convenient, as no further queries need to be executed in order to get at something as simple as a usize. Future evaluations of the same constants will not actually invoke Miri, but just use the cached result.

