} The first line grabs any command line arguments. The second line calls the compiler driver with those arguments. The final line sets the exit code for the program. The only interesting thing is the StupidCalls object we pass to the driver. This is our implementation of the CompilerCalls trait and is what will make this tool different from rustc. StupidCalls is a mostly empty struct: struct StupidCalls { default_calls: RustcDefaultCalls,
} This tool is so simple that it doesn't need to store any data here, but usually you would. We embed a RustcDefaultCalls object to delegate to in our impl when we want exactly the same behaviour as the Rust compiler. Mostly you don't want to do that (or at least don't need to) in a tool. However, Cargo calls rustc with the --print file-names, so we delegate in late_callback and no_input to keep Cargo happy. Most of the rest of the impl of CompilerCalls is trivial: impl<'a> CompilerCalls<'a> for StupidCalls { fn early_callback(&mut self, _: &getopts::Matches, _: &config::Options, _: &diagnostics::registry::Registry, _: ErrorOutputType) -> Compilation { Compilation::Continue } fn late_callback(&mut self, t: &TransCrate, m: &getopts::Matches, s: &Session, c: &CrateStore, i: &Input, odir: &Option<PathBuf>, ofile: &Option<PathBuf>) -> Compilation { self.default_calls.late_callback(t, m, s, c, i, odir, ofile); Compilation::Continue } fn some_input(&mut self, input: Input, input_path: Option<Path>) -> (Input, Option<Path>) { (input, input_path) } fn no_input(&mut self, m: &getopts::Matches, o: &config::Options, odir: &Option<Path>, ofile: &Option<Path>, r: &diagnostics::registry::Registry) -> Option<(Input, Option<Path>)> { self.default_calls.no_input(m, o, odir, ofile, r); // This is not optimal error handling. panic!("No input supplied to stupid-stats"); } fn build_controller(&mut self, _: &Session) -> driver::CompileController<'a> { ... }
} We don't do anything for either of the callbacks, nor do we change the input if the user supplies it. If they don't, we just panic!, this is the simplest way to handle the error, but not very user-friendly, a real tool would give a constructive message or perform a default action. In build_controller we construct our CompileController. We only want to parse, and we want to inspect macros before expansion, so we make compilation stop after the first phase (parsing). The callback after that phase is where the tool does it's actual work by walking the AST. We do that by creating an AST visitor and making it walk the AST from the top (the crate root). Once we've walked the crate, we print the stats we've collected: fn build_controller(&mut self, _: &Session) -> driver::CompileController<'a> { // We mostly want to do what rustc does, which is what basic() will return. let mut control = driver::CompileController::basic(); // But we only need the AST, so we can stop compilation after parsing. control.after_parse.stop = Compilation::Stop; // And when we stop after parsing we'll call this closure. // Note that this will give us an AST before macro expansions, which is // not usually what you want. control.after_parse.callback = box |state| { // Which extracts information about the compiled crate... let krate = state.krate.unwrap(); // ...and walks the AST, collecting stats. let mut visitor = StupidVisitor::new(); visit::walk_crate(&mut visitor, krate); // And finally prints out the stupid stats that we collected. let cratename = match attr::find_crate_name(&krate.attrs[]) { Some(name) => name.to_string(), None => String::from_str("unknown_crate"), }; println!("In crate: {},\n", cratename); println!("Found {} uses of `println!`;", visitor.println_count); let (common, common_percent, four_percent) = visitor.compute_arg_stats(); println!("The most common number of arguments is {} ({:.0}% of all functions);", common, common_percent); println!("{:.0}% of functions have four or more arguments.", four_percent); }; control
} That is all it takes to create your own drop-in compiler replacement or custom compiler! For the sake of completeness I'll go over the rest of the stupid-stats tool. struct StupidVisitor { println_count: usize, arg_counts: Vec<usize>,
} The StupidVisitor struct just keeps track of the number of println!s it has seen and the count for each number of arguments. It implements rustc_ast::visit::Visitor to walk the AST. Mostly we just use the default methods, these walk the AST taking no action. We override visit_item and visit_mac to implement custom behaviour when we walk into items (items include functions, modules, traits, structs, and so forth, we're only interested in functions) and macros: impl<'v> visit::Visitor<'v> for StupidVisitor { fn visit_item(&mut self, i: &'v ast::Item) { match i.node { ast::Item_::ItemFn(ref decl, _, _, _, _) => { // Record the number of args. self.increment_args(decl.inputs.len()); } _ => {} } // Keep walking. visit::walk_item(self, i) } fn visit_mac(&mut self, mac: &'v ast::Mac) { // Find its name and check if it is "println". let ast::Mac_::MacInvocTT(ref path, _, _) = mac.node; if path_to_string(path) == "println" { self.println_count += 1; } // Keep walking. visit::walk_mac(self, mac) }
} The increment_args method increments the correct count in StupidVisitor::arg_counts. After we're done walking, compute_arg_stats does some pretty basic maths to come up with the stats we want about arguments.

