A control-flow graph is a common term from compilers. If you've ever used a flow-chart, then the concept of a control-flow graph will be pretty familiar to you. It's a representation of your program that exposes the underlying control flow in a very clear way. A control-flow graph is structured as a set of basic blocks connected by edges. The key idea of a basic block is that it is a set of statements that execute "together" – that is, whenever you branch to a basic block, you start at the first statement and then execute all the remainder. Only at the end of the block is there the possibility of branching to more than one place (in MIR, we call that final statement the terminator ): bb0: { statement0; statement1; statement2; ... terminator;
} Many expressions that you are used to in Rust compile down to multiple basic blocks. For example, consider an if statement: a = 1;
if some_variable { b = 1;
} else { c = 1;
}
d = 1; This would compile into four basic blocks: BB0: { a = 1; if some_variable { goto BB1 } else { goto BB2 }
} BB1: { b = 1; goto BB3;
} BB2: { c = 1; goto BB3;
} BB3: { d = 1; ...;
} When using a control-flow graph, a loop simply appears as a cycle in the graph, and the break keyword translates into a path out of that cycle.

